import React from 'react'
  
import PropTypes from 'prop-types'
const Header = (title) => {
    return (
      <header>
          <h1>task Tracker {title}</h1>
      </header>
    )
}

Header.propTypes = {
  title: PropTypes.string,
}
export default Header
